comment:
6배나 비싼 모델링팩들이군요
@쁘띠라의 프리미엄 코튼겔 모델링팩 쿨링은 약간 화~한 향, 쿨링감 좋고  가루날림이 조금 있는 전형적인 모델링 팩이다
@더마벨의 로얄 해초 모델링 팩은 규조토가 안 들어 있고  발림성 별로  겔마스크에 가까운 그런 제형
@데쌍브르 스피룰리나 모델링팩은 발림성 좋음 전형적인 모델링 팩
@더메오 더 리타임 스피룰리나 고무팩은 데쌍브르 스피룰리나 모델링팩이랑 성분 구성이 좀 비슷하다
@이타카 인텐스 리페어 스피룰리나 마스크는 스피루리나의 함량이 높다
그런데  이 모두 비싸서 못쓰는 현실...
